          <div className="col-md-12 d-flex justify-content-center">
            <h1>تواصل معي</h1>
          </div>
          <div className="col-md-6">
            img
          </div>
          <div className="col-md-6"></div>
        </div>
      </div>
    </div>
  );
}

export default ContactUs;
